INSERT INTO public.artifact (id, site_id, manufact_id, year_exc, unit_exc, leader_exc, artif_position, field_id, artif_depository, depository_id, description, artif_g, artif_preservation, munsell_hue, munsell_value, munsell_chroma, munsell_code, munsell_name) VALUES (133, 1, 15, '2017', 'Подводный отряд ИА РАН', 'Ольховский С. В.', '280ЖД.6', 'ПАБ-17.280ЖД.4.к.о.44', 'Восточно-Крымский ИКМЗ', 'НВФ-19647', 'Амфоры неопределенного центра стенки с верхним прилепом овальной ручки с клеймом фрагмент. Глина желтовато-коричневая рыхлая с большим количеством песка вкраплениями пироксена и золотистой слюды. Клеймо рельефное в подпрямоугольной рамке анэпиграфное. С тремя эмблемами: канфар лист плюща и лабрис. Глина желтовато-коричневая рыхлая с большим количеством песка вкраплениями пироксена и золотистой слюды.', 'амфора', 'фрагмент', NULL, NULL, NULL, '/', NULL);
